      <text id="67" justification="0" size="4" underlined="false">
        <text>L&apos;azienda SchoolRobot produce robot per l&apos;industria metallurgica. Tutti i robot dispongono di un microprocessore (di cui si vuole conoscere velocità di clock e modello) e di memoria RAM (di cui si vuole conoscere la dimensione in MB).
Una tipologia di robot serve per il taglio laser di lamiere (tipo A), una per la saldatura automatica (tipo B) ed una per la tornitura a controllo numerico (tipo C). L&apos;azienda ha necessità di memorizzare gli ordini dei clienti. Per ogni ordine occorre
memorizzare la denominazione del cliente, indirizzo, numero d&apos;ordine, data ordine e l&apos;elenco dei robot ordinati. Per i robot di tipo A occorre indicare tipo del processore, quantità di memoria, spessore di taglio in mm, precisione (decimi di millimetro);
per i robot di tipo B occorre indicare tipo del processore, quantità di memoria, nr punti di saldatura al secondo; per il il tipo C occorre indicare tipo del processore, quantità di memoria, materiali lavorabili (acciaio, alluminio, ferro). Si proceda a:
- implementare tutte le classi necessarie in codice java compresa la classe per gestire le eccezioni;
- implementare il metodo public void addCliente() in grado di richiedere all&apos;utente l&apos;inserimento da tastiera dei dati di un cliente ed aggiungerlo all&apos;elenco clienti</text>
      </text>
